import styled from "styled-components";

export const ContactWrapper = styled.div`
	display: flex;
	flex-direction: row;
	background: #1a1a1a;
	height: 100vh;
	div {
		padding: 50px;
		width: 100%;
	}
`;

export const FormWrapper = styled.div`
	background: white;
`;
